(609, 125, 'etude_wysiwig_etude', '<div class=\"col col-left\">\r\n<div class=\"textes-container\">\r\n<div class=\"text format ng-isolate-scope fade-in-when-visible\">\r\n\r\nOffrez-vous une étude complète d’architecte d’intérieur dès lors que vous êtes intéressés par du mobilier de notre magasin.\r\n\r\n&nbsp;\r\n\r\n<strong>Pour 150 € au lieu de 1100 €, vous recevez un projet de réaménagement complet d’une pièce ou de l’ensemble de votre maison.</strong>\r\n\r\n</div>\r\n<div class=\"banner blanc-noir\">\r\n<div class=\"banner-content\">\r\n<div class=\"content\">\r\n<div class=\"col col-right format\">\r\n<p class=\"titre-liste ng-isolate-scope fade-in-when-visible\">Nous vous aidons à définir une ambiance et à décrire l’espace :</p>\r\n\r\n<ul class=\"liste\">\r\n 	<li class=\"ng-isolate-scope fade-in-when-visible\">\r\n<p class=\"texte\">Schémas de circulation</p>\r\n</li>\r\n 	<li class=\"ng-isolate-scope fade-in-when-visible\">\r\n<p class=\"texte\">Habillage des fenêtres</p>\r\n</li>\r\n 	<li class=\"ng-isolate-scope fade-in-when-visible\">\r\n<p class=\"texte\">Habillage des murs</p>\r\n</li>\r\n 	<li class=\"ng-isolate-scope fade-in-when-visible\">\r\n<p class=\"texte\">Conseil en couleurs (peintures, tapisserie, etc.)</p>\r\n</li>\r\n 	<li class=\"ng-isolate-scope fade-in-when-visible\">\r\n<p class=\"texte\">Réintégration de vieux mobilier</p>\r\n</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),
(610, 125, '_etude_wysiwig_etude', 'field_5e20295a242a6'),
(611, 125, 'etude_repeater_etude', '1'),
