(842, 129, '_etude_ss-titre_etude', 'field_5e202927242a5'),
(843, 129, 'etude_wysiwig_etude', '<div class=\"col col-left\">\r\n<div class=\"textes-container\">\r\n<div class=\"text format ng-isolate-scope fade-in-when-visible\">\r\n\r\nOffrez-vous une étude complète d’architecte d’intérieur dès lors que vous êtes intéressés par du mobilier de notre magasin.\r\n\r\n<strong>Pour 150 € au lieu de 1100 €, vous recevez un projet de réaménagement complet d’une pièce ou de l’ensemble de votre maison.</strong>\r\n\r\n</div>\r\n<div class=\"banner blanc-noir\">\r\n<div class=\"banner-content\">\r\n<div class=\"content\">\r\n<div class=\"col col-right format\">\r\n<p class=\"titre-liste ng-isolate-scope fade-in-when-visible\">Nous vous aidons à définir une ambiance et à décrire l’espace :</p>\r\n\r\n<ul class=\"liste\">\r\n 	<li class=\"ng-isolate-scope fade-in-when-visible\">\r\n<p class=\"texte\">Schémas de circulation</p>\r\n</li>\r\n 	<li class=\"ng-isolate-scope fade-in-when-visible\">\r\n<p class=\"texte\">Habillage des fenêtres</p>\r\n</li>\r\n 	<li class=\"ng-isolate-scope fade-in-when-visible\">\r\n<p class=\"texte\">Habillage des murs</p>\r\n</li>\r\n 	<li class=\"ng-isolate-scope fade-in-when-visible\">\r\n<p class=\"texte\">Conseil en couleurs (peintures, tapisserie, etc.)</p>\r\n</li>\r\n 	<li class=\"ng-isolate-scope fade-in-when-visible\">\r\n<p class=\"texte\">Réintégration de vieux mobilier</p>\r\n</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),
(844, 129, '_etude_wysiwig_etude', 'field_5e20295a242a6'),
(845, 129, 'etude_repeater_etude', '1'),
(846, 129, '_etude_repeater_etude', 'field_5e202988242a7'),
(847, 129, 'etude', ''),
(848, 129, '_etude', 'field_5e2028e5242a3'),
(849, 129, 'nghi_stephan_titre_ns', 'Nghi & Stephan'),
(850, 129, '_nghi_stephan_titre_ns', 'field_5e202a04242a9'),
(851, 129, 'nghi_stephan_ss-titre_ns', 'Architecte d’intérieur et designer'),
(852, 129, '_nghi_stephan_ss-titre_ns', 'field_5e202a16242aa'),
(853, 129, 'nghi_stephan_wysiwig_ns', '<img class=\"size-medium wp-image-121 alignleft\" src=\"http://localhost/wp-site/wp-content/uploads/2020/01/1000x1300_02-231x300.jpg\" alt=\"\" width=\"231\" height=\"300\" />\r\n\r\nElle est architecte d’intérieur, lui designer. Elle associe, il compose, elle colore, il meuble, elle illumine, il décore. Depuis tant d’années qu’ils travaillent ensemble, Nghi et Stéphan savent comment rendre réels les besoins et les envies des clients.\r\n\r\nChaque projet d’architecture d’intérieur commence par une écoute et une visite qui servent à dessiner les contours d’un cahier des charges et qui déjà servent d’inspiration.\r\n\r\nLes propositions de tissus et d’ameublement qui sont ensuite présentées aux clients ajoutent élégance et originalité tout en respectant leur première intuition.\r\n\r\nIl y a trois réponses possibles au design : oui, non et wow. Nous travaillons toujours pour cette dernière.'),
(854, 129, '_nghi_stephan_wysiwig_ns', 'field_5e202b75fc151'),
(855, 129, 'nghi_stephan', ''),
(856, 129, '_nghi_stephan', 'field_5e2029d0242a8'),
