(1241, 133, 'etude_ss-titre_etude', 'Plutôt une bonne affaire, non?'),
(1242, 133, '_etude_ss-titre_etude', 'field_5e202927242a5'),
(1243, 133, 'etude_wysiwig_etude', '<div class=\"col col-left\">\r\n<div class=\"textes-container\">\r\n<div class=\"text format ng-isolate-scope fade-in-when-visible\">\r\n\r\nOffrez-vous une étude complète d’architecte d’intérieur dès lors que vous êtes intéressés par du mobilier de notre magasin.\r\n\r\n<strong>Pour 150 € au lieu de 1100 €, vous recevez un projet de réaménagement complet d’une pièce ou de l’ensemble de votre maison.</strong>\r\n\r\n</div>\r\n</div>\r\n</div>'),
(1244, 133, '_etude_wysiwig_etude', 'field_5e20295a242a6'),
(1245, 133, 'etude_repeater_etude', '6'),
(1246, 133, '_etude_repeater_etude', 'field_5e202988242a7'),
(1247, 133, 'etude', ''),
(1248, 133, '_etude', 'field_5e2028e5242a3'),
(1249, 133, 'nghi_stephan_titre_ns', 'Nghi & Stephan'),
(1250, 133, '_nghi_stephan_titre_ns', 'field_5e202a04242a9'),
(1251, 133, 'nghi_stephan_ss-titre_ns', 'Architecte d’intérieur et designer'),
(1252, 133, '_nghi_stephan_ss-titre_ns', 'field_5e202a16242aa'),
(1253, 133, 'nghi_stephan_wysiwig_ns', '<img class=\"size-medium wp-image-121 alignleft\" src=\"http://localhost/wp-site/wp-content/uploads/2020/01/1000x1300_02-231x300.jpg\" alt=\"\" width=\"231\" height=\"300\" />\r\n\r\nElle est architecte d’intérieur, lui designer. Elle associe, il compose, elle colore, il meuble, elle illumine, il décore. Depuis tant d’années qu’ils travaillent ensemble, Nghi et Stéphan savent comment rendre réels les besoins et les envies des clients.\r\n\r\nChaque projet d’architecture d’intérieur commence par une écoute et une visite qui servent à dessiner les contours d’un cahier des charges et qui déjà servent d’inspiration.\r\n\r\nLes propositions de tissus et d’ameublement qui sont ensuite présentées aux clients ajoutent élégance et originalité tout en respectant leur première intuition.\r\n\r\nIl y a trois réponses possibles au design : oui, non et wow. Nous travaillons toujours pour cette dernière.'),
(1254, 133, '_nghi_stephan_wysiwig_ns', 'field_5e202b75fc151'),
(1255, 133, 'nghi_stephan', ''),
(1256, 133, '_nghi_stephan', 'field_5e2029d0242a8'),
(1257, 133, 'tissus_et_artisanat_repeater_ta', '3'),
(1258, 133, '_tissus_et_artisanat_repeater_ta', 'field_5e202c27fc153'),
(1259, 133, 'tissus_et_artisanat_titre_ta', 'Tissus et artisanat'),
(1260, 133, '_tissus_et_artisanat_titre_ta', 'field_5e202e5dfc156'),
(1261, 133, 'tissus_et_artisanat_ss-titre_ta', 'Habillage de meubles et de fenêtres'),
(1262, 133, '_tissus_et_artisanat_ss-titre_ta', 'field_5e202e68fc157'),
(1263, 133, 'tissus_et_artisanat_wysiwig_ta', '<div class=\"textes-container left\">\r\n<div class=\"texte format ng-isolate-scope fade-in-when-visible\">\r\n\r\njoutez un brin de tissus dans vos intérieurs et changez toute une ambiance : l’esthétique, la mise en valeur de mobilier ou d’éléments d’architecture, la réverbération du son, de la lumière, etc.\r\n\r\n&nbsp;\r\n\r\nNous avons un choix formidable de tissus à vous présenter et à assortir entre eux : Diaz, etc.\r\n\r\n&nbsp;\r\n\r\n</div>\r\n</div>\r\n<div class=\"textes-container right\">\r\n<div class=\"texte format ng-isolate-scope fade-in-when-visible\">\r\n\r\nTravail selon les méthodes artisanales :\r\n<ul>\r\n 	<li>Regarnissage et rhabillage de toutes pièces de mobilier, même neuves.</li>\r\n 	<li>Confection de tentures, de stores et de rideaux.</li>\r\n 	<li>Tapisseries murales</li>\r\n 	<li>Canapés personnalisés</li>\r\n 	<li>Tapis</li>\r\n</ul>\r\n</div>\r\n</div>'),
