(1642, 137, '_etude_ss-titre_etude', 'field_5e202927242a5'),
(1643, 137, 'etude_wysiwig_etude', '<div class=\"col col-left\">\r\n<div class=\"textes-container\">\r\n<div class=\"text format ng-isolate-scope fade-in-when-visible\">\r\n\r\nOffrez-vous une étude complète d’architecte d’intérieur dès lors que vous êtes intéressés par du mobilier de notre magasin.\r\n\r\n<strong>Pour 150 € au lieu de 1100 €, vous recevez un projet de réaménagement complet d’une pièce ou de l’ensemble de votre maison.</strong>\r\n\r\n</div>\r\n</div>\r\n</div>'),
(1644, 137, '_etude_wysiwig_etude', 'field_5e20295a242a6'),
(1645, 137, 'etude_repeater_etude', '6'),
(1646, 137, '_etude_repeater_etude', 'field_5e202988242a7'),
(1647, 137, 'etude', ''),
(1648, 137, '_etude', 'field_5e2028e5242a3'),
(1649, 137, 'nghi_stephan_titre_ns', 'Nghi & Stephan'),
(1650, 137, '_nghi_stephan_titre_ns', 'field_5e202a04242a9'),
(1651, 137, 'nghi_stephan_ss-titre_ns', 'Architecte d’intérieur et designer'),
(1652, 137, '_nghi_stephan_ss-titre_ns', 'field_5e202a16242aa'),
(1653, 137, 'nghi_stephan_wysiwig_ns', '<img class=\"wp-image-121 alignleft\" src=\"http://localhost/wp-site/wp-content/uploads/2020/01/1000x1300_02-231x300.jpg\" alt=\"\" width=\"444\" height=\"577\" />\r\n\r\nElle est architecte d’intérieur, lui designer. Elle associe, il compose, elle colore, il meuble, elle illumine, il décore. Depuis tant d’années qu’ils travaillent ensemble, Nghi et Stéphan savent comment rendre réels les besoins et les envies des clients.\r\n\r\nChaque projet d’architecture d’intérieur commence par une écoute et une visite qui servent à dessiner les contours d’un cahier des charges et qui déjà servent d’inspiration.\r\n\r\nLes propositions de tissus et d’ameublement qui sont ensuite présentées aux clients ajoutent élégance et originalité tout en respectant leur première intuition.\r\n\r\nIl y a trois réponses possibles au design : oui, non et wow. Nous travaillons toujours pour cette dernière.'),
(1654, 137, '_nghi_stephan_wysiwig_ns', 'field_5e202b75fc151'),
(1655, 137, 'nghi_stephan', ''),
(1656, 137, '_nghi_stephan', 'field_5e2029d0242a8'),
