(1858, 139, '_tissus_et_artisanat_repeater_ta', 'field_5e202c27fc153'),
(1859, 139, 'tissus_et_artisanat_titre_ta', 'Tissus et artisanat'),
(1860, 139, '_tissus_et_artisanat_titre_ta', 'field_5e202e5dfc156'),
(1861, 139, 'tissus_et_artisanat_ss-titre_ta', 'Habillage de meubles et de fenêtres'),
(1862, 139, '_tissus_et_artisanat_ss-titre_ta', 'field_5e202e68fc157'),
(1863, 139, 'tissus_et_artisanat_wysiwig_ta', '<div class=\"textes-container left\">\r\n<div class=\"texte format ng-isolate-scope fade-in-when-visible\">\r\n\r\njoutez un brin de tissus dans vos intérieurs et changez toute une ambiance : l’esthétique, la mise en valeur de mobilier ou d’éléments d’architecture, la réverbération du son, de la lumière, etc.\r\n\r\n&nbsp;\r\n\r\nNous avons un choix formidable de tissus à vous présenter et à assortir entre eux : Diaz, etc.\r\n\r\n&nbsp;\r\n\r\n</div>\r\n</div>\r\n<div class=\"textes-container right\">\r\n<div class=\"texte format ng-isolate-scope fade-in-when-visible\">\r\n\r\nTravail selon les méthodes artisanales :\r\n<ul>\r\n 	<li>Regarnissage et rhabillage de toutes pièces de mobilier, même neuves.</li>\r\n 	<li>Confection de tentures, de stores et de rideaux.</li>\r\n 	<li>Tapisseries murales</li>\r\n 	<li>Canapés personnalisés</li>\r\n 	<li>Tapis</li>\r\n</ul>\r\n</div>\r\n</div>'),
