(2249, 144, 'etude_wysiwig_etude', '<h2><strong>150 € l’étude d’archi</strong></h2>\r\n<h5>Plutôt une bonne affaire, non?</h5>\r\nOffrez-vous une étude complète d’architecte d’intérieur dès lors que vous êtes intéressés par du mobilier de notre magasin.\r\n\r\n<strong>Pour 150 € au lieu de 1100 €, vous recevez un projet de réaménagement complet d’une pièce ou de l’ensemble de votre maison.</strong>'),
(2250, 144, '_etude_wysiwig_etude', 'field_5e20295a242a6'),
(2251, 144, 'etude_repeater_etude', '6'),
(2252, 144, '_etude_repeater_etude', 'field_5e202988242a7'),
(2253, 144, 'etude', ''),
(2254, 144, '_etude', 'field_5e2028e5242a3'),
(2255, 144, 'nghi_stephan_titre_ns', 'Nghi & Stephan'),
(2256, 144, '_nghi_stephan_titre_ns', 'field_5e202a04242a9'),
(2257, 144, 'nghi_stephan_ss-titre_ns', 'Architecte d’intérieur et designer'),
(2258, 144, '_nghi_stephan_ss-titre_ns', 'field_5e202a16242aa'),
(2259, 144, 'nghi_stephan_wysiwig_ns', 'Elle est architecte d’intérieur, lui designer. Elle associe, il compose, elle colore, il meuble, elle illumine, il décore. Depuis tant d’années qu’ils travaillent ensemble, Nghi et Stéphan savent comment rendre réels les besoins et les envies des clients.\r\n\r\nChaque projet d’architecture d’intérieur commence par une écoute et une visite qui servent à dessiner les contours d’un cahier des charges et qui déjà servent d’inspiration.\r\n\r\nLes propositions de tissus et d’ameublement qui sont ensuite présentées aux clients ajoutent élégance et originalité tout en respectant leur première intuition.\r\n\r\nIl y a trois réponses possibles au design : oui, non et wow. Nous travaillons toujours pour cette dernière.'),
(2260, 144, '_nghi_stephan_wysiwig_ns', 'field_5e202b75fc151'),
(2261, 144, 'nghi_stephan', ''),
